import React from 'react';
import styled from 'styled-components';
import './App.css';
import './styles/spacing.css';
import './styles/colors.css';
import SectionShowcase from './components/Section/SectionShowcase';

const AppContainer = styled.div`
  padding: 2rem 30px;
  max-width: 1350px;
  margin: 0 auto;
`;

const Header = styled.header`
  margin-bottom: 3rem;
`;

function App() {
  return (
    <AppContainer>
      <Header>
        <h1>NVIDIA Lab Research Component Hub</h1>
        <p class="nv-text-large">A collection of reusable components and sections for NVIDIA websites.</p>
      </Header>

      <SectionShowcase />
    </AppContainer>
  );
}

export default App;
